import React from 'react';
import './Navbar.css'


const Navbar = () =>{
    return(
        <nav className='nav col-xl-2'>
          <ul>
            <li><a href='#1'>Profile</a></li>
            <li><a href='#1'>Messages</a></li>
            <li><a href='#1'>News</a></li>
            <li><a href='#1'>Settings</a></li>
            <li><a href='#1'>Music</a></li>
          </ul>
        </nav>
    )
}
export default Navbar;
